for i,v in pairs(game:GetService('Workspace').MAP:GetChildren()) do if v:IsA("Part") then v:Destroy() end end for i,v in pairs(game:GetService("Workspace").MAP.Indestructible:GetChildren()) do if v:IsA('Model') then v:Destroy() end end game:GetService("Workspace").print:Destroy() game:GetService("Workspace").Cashiers:Destroy() game:GetService("Workspace").Bush:Destroy() for i,v in pairs(game:GetService("Workspace").Players:GetChildren()) do if v.Name ~= game.Players.LocalPlayer.Name then v:Destroy() end end game:GetService("Workspace").Vehicles:Destroy() game:GetService("Workspace").Lights:Destroy() for i,v in pairs(game:GetService("Workspace"):GetChildren()) do if v:IsA("Model") or v:IsA("Part") then v:Destroy() end end game:GetService("Workspace").Ignored:Destroy()
